-- I0053635
-- exposition_coefficients contiene i moltiplicatori associati ai coefficienti di esposizione CVM o amianto.
-- ad ogni codice FOGLIA contenuto in ExposureType (/AMI o /CVM) dovrebbe in teoria corrispondere una riga in exposition_coefficients
-- con relativo moltiplicatore


update code_value set lang_it=replace(lang_it, ' * ', ' | ') where id like 'phidic.spisal.mdl.exptype.cvm.%';

update attivita a set a.commissione_id = (select c.internal_id from commissioni c where c.attivita_id = a.internal_id);

join infortuni i on ((i.persone_giuridiche_id=ditta.internal_id and i.place='phidic.spisal.segnalazioni.place.owncompany_V0') or (i.pg_ext_id=ditta.internal_id and i.place='phidic.spisal.segnalazioni.place.company_V0'))
join procpratiche p on (i.idprocpratica=p.internal_id)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area = 'phidic.spisal.pratiche.type.workaccident_V0' and i.is_active=1 and ditta.codice_fiscale is not null;

join ditte_malattie dmal on (dmal.persone_giuridiche_id=ditta.internal_id and dmal.is_active=1)
join malattie_professionali mal on (mal.internal_id=dmal.malattia_professionale_id)
join procpratiche p on (mal.internal_id=p.malattia_professionale_id)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area = 'phidic.spisal.pratiche.type.workddisease_V0' and mal.is_active=1 and ditta.codice_fiscale is not null;

join persona_giuridica_sede pgs on (pgs.persona_giuridica_id=ditta.internal_id and pgs.is_active=1)
join vigilanza vig on (vig.internal_id=pgs.vigilanza_id and vig.type is not null)
join procpratiche p on (vig.internal_id=p.vigilanza_id)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area = 'phidic.spisal.pratiche.type.supervision_V0'
and ((vig.type='phidic.spisal.segnalazioni.supervision.types.yard_V0' and pgs.checked=1) or (vig.type<>'phidic.spisal.segnalazioni.supervision.types.yard_V0')) and vig.is_active=1 and ditta.codice_fiscale is not null;

join pratiche_riferimenti pref on (pref.richiedente_ditta_id=ditta.internal_id and pref.is_active=1)
join procpratiche p on (pref.internal_id=p.pratiche_riferimenti_id)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area = 'phidic.spisal.pratiche.type.technicaladvice_V0' and ditta.codice_fiscale is not null;

join soggetto s on (s.ditta_id=ditta.internal_id and s.code='phidic.spisal.segnalazioni.targetsource.ditta_V0' and s.is_active=1)
join attivita a on (a.internal_id=s.attivita_id and a.is_active=1)
join procpratiche p on (a.procpratiche_id=p.internal_id and p.is_active=1)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area = 'phidic.spisal.pratiche.type.supervision_V0' and ditta.codice_fiscale is not null;

join attivita a on (a.luogo='phidic.spisal.segnalazioni.targetsource.ditta_V0' and a.luogo_ditta_id=ditta.internal_id and a.is_active=1)
join procpratiche p on (a.procpratiche_id=p.internal_id and p.is_active=1)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area = 'phidic.spisal.pratiche.type.supervision_V0' and ditta.codice_fiscale is not null;

join soggetto sogg on (sogg.code='phidic.spisal.segnalazioni.targetsource.ditta_V0' and sogg.ditta_id=ditta.internal_id and sogg.is_active=1)
join provvedimenti prov on (sogg.internal_id=prov.soggetto_id and prov.is_active=1)
join attivita a on (a.internal_id=prov.attivita_id and a.is_active=1)
join procpratiche p on (a.procpratiche_id=p.internal_id and p.is_active=1)
join service_delivery_location sdl on p.servicedeliverylocation = sdl.internal_id
where sdl.area is not null and ditta.codice_fiscale is not null;